('Flimeal Coklat Susu 12 Sachet','489','9','12','Protein Kedelai Isolate \n\nMengandung 40% protein dan 35% karbohidrat larut (sukrosa, stachyose, rafinosa), karbohidrat tidak larut (serat makanan), serta 90% protein lebih tinggi dibanding susu sapi, kedelai isolat tepat bagi Anda yang sedang menjaga berat badan namun alergi terhadap susu sapi, karena kedelai isolat tidak mengandung zat alergen. \n\n\n\nBeras Coklat \n\nBeras coklat mengandung serat, GABA (aminobutyric acid), Asam amino esensial Lysine, antioksidan, potasium, riboflavin (vitamin B2), folat, zat besi, kalsium, selenium, dan folat. Kandungan serat tersebut lebih lambat dicerna tubuh sehingga membuat rasa kenyang lebih tahan lama. \n\n\n\nChia Seed \n\nMengandung protein sebanyak 15-25%, lemak 30-33%, karbohidrat 26-41%, serat 18-30%, mineral 4-5%, dan asam lemak omega 3 (asam linolenat) sebesar 17,83%. Biji chia mampu membentuk gum melalui proses hidrasi di dalam pencernaan untuk mengurai karbohidrat menjadi gula yang diperlukan sehingga terciptanya rasa kenyang lebih lama. Selain itu, chia seed juga bermanfaat untuk menurunkan berat badan bagi penderita obesitas. \n\n\n\nBubuk flaxseed oil \n\nFlaxseed oil dapat menurunkan insulin dan meningkatkan kapasitas antioksidan layaknya minyak ikan atau fish oil. Minyak sehat yang berasal dari tumbuhan ini tidak ada berbau amis yang mengganggu seperti minyak ikan. Flaxseed oil mengandung asam lemak omega-3, protein, dan serat. Komponen fenolat, kalsium dan magnesium yang juga bermanfaat bagi tubuh untuk memperlancar pembuluh darah. ','{"Makanan & Minuman", "Penawaran Special", "Vitamin & Suplemen", "Kesehatan Pencernaan", "Diet, Sehat & Bugar", "Serat", "Penurun Berat Badan"}','Flimeal adalah minuman Pengganti Makanan (Meal Replacement) yang sudah diformulasikan secara detail untuk memastikan semua kandunganya berkualitas tinggi, khusus untuk Anda yang ingin mempertahankan atau menurunkan berat badan. \n\n\n\nMengandung bahan Alami Tinggi Protein (30%) dan Serat (15%) seperti kacang-kacangan, kedelai isolat, dan chia seed, Flimeal berfungsi sebagai minuman pengganti sarapan untuk memenuhi kebutuhan nutrisi serta energi harian Anda tanpa berpengaruh terhadap peningkatan berat badan Anda.','24','Per Box','696.0','1.83','1.29','0.58','https://d2qjkwm11akmwu.cloudfront.net/products/4718_8-1-2023_23-2-56.png','1298','true'),
